import React from "react";
import { Link } from "react-router-dom";

const ProjectsPage = () => {
  return (
    <div>
      <section class="sub-header">
        <nav>
          <Link to="lLinkndingpage.html">
            <img src="./landingpage_img/logo.png" />
          </Link>
        </nav>
        <h1>All Projects</h1>
      </section>
    </div>
  );
};

export default ProjectsPage;
